import React from 'react';

function Card({href}) {
  return (
    <div className="card">
    <a href={href}>
     <img src={img} alt="img" className="cardImg" />
     </a>
     <p className="cardTitle">{title}</p>
     <p className="cardPrice">{price}</p>
  </div>
  );
}

export default Card;
